import React from 'react'
import ItemSearch from './ItemSearch'
import ItemList from './ItemList'

function ItemPicker() {
  return (
    <div className='ItemPicker'>
        <div>Выберите предмет</div>
        <ItemSearch/>
        <ItemList/>
    </div>
  )
}

export default ItemPicker
